    function generate() {
      const old = document.querySelector('input[name="oldArch"]:checked')?.value;
      const nw = document.querySelector('input[name="newArch"]:checked')?.value;
      const plan = document.querySelector('input[name="plan"]:checked')?.value;
      const key = old + "|" + nw + "|" + plan;
      
      
      let raw = solutionMap[key] || "⚠️ 此組合尚未設定結果，請補充條件至對照表。";
      let result = raw.replace(/，?nan/g, "").replace(/，+/g, "，").replace(/^，|，$/g, "").trim();
    
    

      const extras = [];
      if (document.getElementById("ap保固").checked) extras.push("終保AP沿用需設定");
            if (document.getElementById("refundPolicy").checked) extras.push("退費規範已說明");
      if (document.getElementById("transferMonth").checked) extras.push("待新址結單後月份轉移");
      if (document.getElementById("groupBuy").checked) result += "（參與團購）";
      if (extras.length > 0) result += "，" + extras.join("，");
      document.getElementById("output").textContent = result;
    }

    function copyResult() {
      const text = document.getElementById("output").textContent;
      if (!text) {
        alert("請先產生方案內容！");
        return;
      }
      navigator.clipboard.writeText(text).then(() => {
        alert("已複製方案內容！");
      });
    }
